import './header.css';
import './footer.css';
import './styles.css';
import 'tailwindcss/tailwind.css';

document.documentElement.style.fontFamily = "'Mina-Regular', sans-serif";

export default function App() {
  return (
    <div className="App flex flex-col">
      <Navbar />
      <Welcome />
      <Footer />
    </div>
  );
}

function Navbar() {
  return (
    <header className="bg-purple z-50 fixed top-0 w-full shadow">
      <nav id="header-nav" className='bg-purple max-w-5xl mx-auto p-0 flex items-center justify-between' >
        <a href="top" className='flex' aria-label="Page d'accueil de PetMeeting">
          <img src="images/logo.png" className='w-52 md:w-80 md:mr-4' alt="Logo de PetMeeting" />
        </a>
        <button aria-label="toggle button" aria-expanded="false" id="menu-btn" className='cursor-pointer w-7 md:hidden'>
          <img src="images/burger.png" alt="Menu hamburger" />
        </button>
        <ul id="toggled-menu" className='w-full absolute top-full left-0 -translate-y-full -z-10 border-b border-gray-200 flex flex-col items'>

        </ul>
      </nav>
    </header>
  );
}

function Welcome() {
  return (
    <main>
      <h1>Bienvenue sur PetMeeting!</h1>
      <div>
        <p>
        "Cet outil est à disposition des éleveurs de chats pour les aider dans leur travail de sélection, en facilitant la mise en relation entre les éleveurs sérieux et passionnés. PetMeeting permet de trouver facilement une saillie extérieure de qualité proche de chez soi. Pour reproducteurs LOOF, sélectionnés, testés, vaccinés, etc..."
        </p>
      </div>
      <div>Carousel</div>
    </main>
  );
}

function Footer() {
  return (
    <footer className='bg-purple bottom-0 text-white p-2'>Tous droits réservés PetMeeting 2024</footer>
  );
}
